kness and the light are both alike to You.\n\n13 For You formed my inward parts;\nYou [f]covered me in my mother’s womb.\n14 I will praise You, for [g]I am fearfully and wonderfully made;\nMarvelous are Your works,\nAnd that my soul knows very well.\n15 My [h]frame was not hidden from You,\nWhen I was made in secret,\nAnd skillfully wrought in the lowest parts of the earth.\n16 Your eyes saw my substance, being yet unformed.\nAnd in Your book they all were written,\nThe days fashioned for me,\nWhen as yet there were none of them.\n\n17 How precious also are Your thoughts to me, O God!\nHow great is the sum of them!\n18 If I should count them, they would be more in number than the sand;\nWhen I awake, I am still with You."}]},"subscribeButton":{"buttonRenderer":{"style":"STYLE_DESTRUCTIVE","size":"SIZE_DEFAULT","isDisabled":false,"text":{"runs":[{"text":"Subscribe"}]},"navigationEndpoint":{"clickTrackingParams":"CJEBEJsrIhMI8t3FuMCT6gIVW0ngCh3slAiR","commandMetadata":{"webCommandMetadata":{"ignoreNavigation":true}},"modalEndpoint":{"modal":{"modalWithTitleAndButtonRenderer":{"title":{"simpleText":"Want to subscribe to this channel?"},"content":{"simpleText":"Sign in to subscribe to this channel."},"button":{"buttonRenderer":{"style":"STYLE_BLUE_TEXT","size":"SIZE_DEFAULT","isDisabled":false,"text":{"simpleText":"Sign in"},"navigationEndpoint":{"clickTrackingParams":"CJIBEP2GBCITCPLdxbjAk-oCFVtJ4Aod7JQIkTIJc3Vic2NyaWJl","commandMetadata":{"webCommandMetadata":{"url":"https://accounts.google.com/ServiceLogin?service=youtube\u0026uilel=3\u0026passive=true\u0026continue=https%3A%2F%2Fwww.youtube.com%2Fsignin%3Faction_handle_signin%3Dtrue%26app%3Ddesktop%26hl%3Den%26next%3D%252Fwatch%253Fv%253DKxpngZJTLBM%26continue_action%3DQUFFLUhqbERNU0RsMk1jS080b2FtNXZXYnNPZWkwRFFaZ3xBQ3Jtc0tra2RFR1d4dGNPQVg2NmhJVmc0ZHBldkU2N29CcGNRS01wckhUU2FuNnZBV0o0M2JzRkotTHlrR1I0dmZyRHBLSW9Dek9HR0IwaVVlUUNVcVd1aDd1VFVHa3BMRzhBZG1tYnR2VXRHVTJFcGhPNG5DSEhRd0FnX0drZ1pVZE5hdmtXbEVOVzA0d1AyZU5Gc0N0amZ
